                            cookiePolicyText: "<p>Company's websites, online services, interactive applications, email messages, and advertisements may use 'cookies' and other technologies such as pixel tags and web beacons. These technologies help us better understand user behavior, tell us which parts of our websites people have visited, and facilitate and measure the effectiveness of advertisements and web searches. We treat information collected by cookies and other technologies as non-personal information. However, to the extent that Internet Protocol (IP) addresses or similar identifiers are considered personal information by local law, we also treat these identifiers as personal information. Similarly, to the extent that non-personal information is combined with personal information, we treat the combined information as personal information for the purposes of this Privacy Policy.</p><p>Ads that are delivered by Company's advertising platform may appear in Company News and in the App Store. If you do not wish to receive ads targeted to your interests from Company's advertising platform, you can choose to enable Limit Ad Tracking, which will opt your Company ID out of receiving such ads regardless of what device you are using. If you enable Limit Ad Tracking on your mobile device, third-party apps cannot use the Advertising Identifier, a non-personal device identifier, to serve you targeted ads. You may still see ads in the App Store or News based on context like your search query or the channel you are reading. In third-party apps, you may see ads based on other information.</p><p>Company and our partners also use cookies and other technologies to remember personal information when you use our website, online services, and applications. Our goal in these cases is to make your experience with Company more convenient and personal. For example, knowing your first name lets us welcome you the next time you visit the Company Online Store. Knowing your country and language - and if you are an educator, your school - helps us provide a customized and more useful shopping experience. Knowing someone using your computer or device has shopped for a certain product or used a particular service helps us make our advertising and email communications more relevant to your interests. And knowing your contact information, hardware identifiers, and information about your computer or device helps us personalize your operating system, set up your iCloud service, and provide you with better customer service.</p><p>If you want to disable cookies and you're using the Safari web browser, go to Safari preferences and then to the privacy pane to manage your preferences. On your Company mobile device, go to Settings, then Safari, scroll down to the Privacy & Security section, and tap on 'Block Cookies' to manage your preferences. For other browsers, check with your provider to find out how to disable cookies. Please note that certain features of the Company website will not be available once cookies are disabled.</p><p>As is true of most internet services, we gather some information automatically and store it in log files. This information includes Internet Protocol (IP) addresses, browser type and language, Internet service provider (ISP), referring and exit websites and applications, operating system, date/time stamp, and clickstream data.</p><p>We use this information to understand and analyze trends, to administer the site, to learn about user behavior on the site, to improve our product and services, and to gather demographic information about our user base as a whole. Company may use this information in our marketing and advertising services.</p><p>In some of our email messages, we use a 'click-through UR' linked to content on the Company website. When customers click one of these URLs, they pass through a separate web server before arriving at the destination page on our website. We track this click-through data to help us determine interest in particular topics and measure the effectiveness of our customer communications. If you prefer not to be tracked in this way, you should not click text or graphic links in the email messages.</p><p>Pixel tags enable us to send email messages in a format customers can read, and they tell us whether mail has been opened. We may use this information to reduce or eliminate messages sent to customers.</p>",
